padded_stabilizers = [s.ljust(135, 'I') for s in stabilizers]

print(f"Total stabilizers: {len(padded_stabilizers)}")

# Check for consistency
paulis = [stim.PauliString(s) for s in padded_stabilizers]
anticommuting = False
for i in range(len(paulis)):
    for j in range(i + 1, len(paulis)):
        if not paulis[i].commutes(paulis[j]):
            print(f"Anticommute: {i} and {j}")
            anticommuting = True

if not anticommuting:
    print("All stabilizers commute after padding.")
    # Generate circuit
    try:
        tableau = stim.Tableau.from_stabilizers(
            paulis,
            allow_redundant=True,
            allow_underconstrained=True
        )
        circuit = tableau.to_circuit(method="elimination")
        print("Circuit generated.")
        
        # Save to file
        with open("circuit_135.stim", "w") as f:
            f.write(str(circuit))
            
    except Exception as e:
        print(f"Error generating circuit: {e}")
else:
    print("Stabilizers still anticommute.")
